Description:
            Personalize your desk and make your work more enjoyable with this original design mouse pad! Perfect for your dorm, cubicle, home or work office. It also makes a great, thoughtful and inexpensive gift for a teacher, coworker, boss, girlfriend or anyone else who uses a computer. Yes, probably, even a grandma these days. 
Love a cuppa while working at your computer? Get a perfectly matching coaster set here: 
https://www.etsy.com/ca/listing/508312355/watercolor-floral-set-of-4-coasters
{ ITEM DESCRIPTION AND OPTIONS }
 This mousepad features a smooth printed fabric top, and a neoprene / non-slip rubber bottom. It is available in 2 styles:
• ROUND shape mouse pad measures 8" (20.2 cm) in diameter
• RECTANGULAR mouse pad is 9" x 7" (22.9 x 17.8 cm) with rounded corners. 
{ CUSTOMIZATION }
I am happy to customize this item for you. I can add a name, monogram or quote on top of the design or discuss any other changes you want. There is no customization fee, however, there is a 5 charge if you require a proof of the design with the change.
{ PRODUCTION and SHIPPING }
Each mouse pad is made to order and ships within 3 to 5 business days via USPS from Arizona, USA.
If this is a gift, it is possible to ship this item directly to your recipient with a gift message. Please provide an address and a gift message in the order notes. 
{ COMBINED SHIPPING COST }
I am able to offer combined shipping cost on purchasing several units of the same item type. Unfortunately, I am not able to offer combined shipping on purchases of different item types. I only charge the actual shipping cost and will promptly refund any amount you overpay for shipping within 24 hrs. 
{ DISCLAIMER }
All printers and monitors reproduce colors differently. I cannot guarantee that what you see on your monitor will exactly match your final piece. All inclusions like gold, foil, glitter, wood, metals, etc. are just the images thereof printed on fabric, not said materials themselves. Props are not included
{ RETURNS }
All orders are final, non-returnable and non-refundable. If your order does not meet your expectations, please contact me and I will do my best to make it right.
{ TERMS OF USE }
All images and content Copyright 2017 Gypsee Art. By purchasing you are granted a personal-use-only permission.
{ DISCOUNTS }
