            Benzie's most helpful tool in determining the perfect match -a color chart of all 90 wool blend felt colors! Large circle swatches of Benzie's merino blend felt are attached to three sheets of bright white cardstock and mailed in a protective covering. 
{ About Benzie's felt }
Wool felt is one of the most versatile and beautiful fabrics to create with, a blend of 20-35% merino wool with the remainder viscose make it resistant to pilling and pulling, easy to cut, affordable -all working together to provide maximum craft-ability. Benzie's felt is approximately 1mm thick. Our carefully curated rainbow includes a wide variety of brilliant and pure colors and is available in cut sheets and yardage. We are honored to be the largest supplier of wool blend felt on Etsy for over five years.
{ About Benzie on Etsy }
A swatch chart is included in the second image of all custom listings, to enlarge click on the magnifying glass found on the lower right hand corner. Color accuracy may vary from screen to screen and we suggest purchasing samples or a swatch chart for complete color accuracy. Coordinating DMC floss is available for all of Benzie's items. Note that our wool felt colors are different from our felt pom colors. For shipping information and general questions visits our policies page: 
https://www.etsy.com/shop/BenzieDesign/policy
